import React from "react";

import "./productImage.styles.css";

const ProductImage = () => {
  return (
    <div className="product-image">
      <img
        className="image"
        src="https://picsum.photos/id/237/300/200
"
        alt="Image"
      />
    </div>
  );
};

export default ProductImage;
